import React,{useState,useEffect} from 'react';

import {useDispatch} from 'react-redux';
import {useSelector} from 'react-redux';
import {fetchCountries} from '../ducks/countries';
import {Input, Select} from 'antd';

function CountryPicker(){

    const[country,setCountry] = useState('');
    const dispatch = useDispatch();


    useEffect(()=>{

        dispatch(fetchCountries());

    },[])

    const countries = useSelector((store)=>{

        return store.countries.countries;

    })

    console.log(countries)

    return(

        <Input.Group >
      <Select defaultValue="" style={{width:"30%"}}  onChange={(e)=>{

          setCountry(e.target.value)

      }}>
        <Select.Option value="">Countries...</Select.Option>
        {countries.map((item,index)=>{

        return <Select.Option value={item.name}>{item.name}</Select.Option>

        })}
      </Select>
      </Input.Group>
    )
}

export default CountryPicker;
